import React from "react";

export const PatternListItem = props => {
  const { title, children } = props;
  return (
    <li style={{marginBottom: "1rem"}}>
      <strong>{title}</strong>&nbsp;
      {children}
    </li>
  );
};

export default PatternListItem;
